import React from 'react';

const Teachers = ({ LOADING_TEACHERS }) => {
  const renderTeachers = teachers.map((teacher)=>
  <p key={teacher.id}>
  Name: {teacher.name}</p>)
  return (
  <div>
    <h1>Teachers </h1>
    {renderTeachers}
  </div>
)};

export default Teachers;
